struct Ref_ {
	Ref_() noexcept : R(0LL) {}
	bool EqAddr(const Ref_* t) noexcept { return this == t; }
	bool EqAddr(const std::shared_ptr<Ref_> t) noexcept { return this == t.get(); }
	int64_t R;
};
struct Class_ : public Ref_ {
	Class_() noexcept : Ref_(), Y(0LL) {}
	int64_t Y;
};
template<typename T> struct Array_ : public Ref_ {
	Array_() noexcept : Ref_(), L(), B() {}
	explicit Array_(int64_t n, ...) noexcept : Ref_() {
		L = n;
		B = new T[static_cast<size_t>(n + bufLen_<T>())];
		va_list l;
		va_start(l, n);
		for (int64_t i = 0; i < n; i++)
			B[i] = va_arg(l, T);
		va_end(l);
		if (bufLen_<T>() > 0)
			B[n] = 0;
	}
	~Array_() {
		delete[] B;
	}
	std::shared_ptr<Array_<T>> Cat(const std::shared_ptr<Array_<T>> t) noexcept {
		std::shared_ptr<Array_<T>> r(new Array_<T>());
		r->B = new T[static_cast<size_t>(L + t->L + bufLen_<T>())];
		std::copy(B, B + L, r->B);
		std::copy(t->B, t->B + t->L + bufLen_<T>(), r->B + L);
		r->L = L + t->L;
		return r;
	}
	int64_t Len() noexcept { return L; }
	T& At(int64_t n) noexcept { return B[n]; }
	int64_t L;
	T* B;
};
