	uint32_t t = rX_ ^ (rX_ << 11);
	rX_ = rY_;
	rY_ = rZ_;
	rZ_ = rW_;
	return rW_ = (rW_ ^ (rW_ >> 19)) ^ (t ^ (t >> 8));
